import React, { useState } from 'react';
import { useHistory } from "react-router-dom";
import { Button } from "react-bootstrap";
import Header from "./Header";
import Footer from "./Footer";
import "../style/SignUp.scss";
// icon
import arrowRight from "../icons/arrow-right.svg";
import lock from "../icons/lock.svg";
import user from "../icons/user.svg";
import mail from "../icons/mail-light.svg";

function SignUp() {
    return (
        <div className="App">
          <Header />
          <div className="container">
            <h1>Create an account</h1>
            <form>
              <span className="icoContainer"><input placeholder="Username"></input><span className="icoPlaceholder"><img src={user}/></span></span>
              <input type="email" placeholder="Email address"/>
              <input type="password" placeholder="Password"></input>
              <button>REGISTER<span style={{marginLeft: "20px"}}className="arrow"><img src={arrowRight}/></span></button>
            </form>
          </div>
          <Footer />
        </div>
    );
}
export default SignUp;
